import React from 'react';
import {motion} from 'framer-motion';

const PageLearn = () => {

  const titleVariants = {
    offscreen: {
      opacity: 0,
      y: 50,
    },
    onscreen: {
      opacity: 1,
      y: 0,
      transition: {
        type: "spring",
        bounce: 0.4,
        duration: 0.8,
      },
    },
  };
  
  return (
    <div className=''>
      <motion.h1         
      className='titleLearn'>How it works</motion.h1>
    </div>
  );
}

export default PageLearn;
